import { Entity, PrimaryGeneratedColumn, Column } from "typeorm";

@Entity()
export class Roll {
  @PrimaryGeneratedColumn()
  id!: number;

  @Column()
  teamId!: string;

  @Column()
  userId!: string;

  @Column()
  pokemonNumber!: number;
}
